with open('data.json') as json_file:
    data = json.load(json_file)
data = data["data"]

# Prepare Data
x = np.array([])
y = np.array([])
for key, val in data.items() :
	x = np.append(x, dates.date2num(datetime.strptime(key, '%Y-%m-%dT%H:%M:%S.%fZ')))
	y = np.append(y, np.log(val[0]))
n = len(x)

# Create Prediction Timeframe
x_extended = x
startTime = x[0]
currTime = x[-1]
timeOffset = (currTime - startTime) / len(x)
for i in range(n, int(n * 1.5)) :
	x_extended = np.append(x_extended, startTime + i * timeOffset)

# Confidence Parameters
c = 0.95
t = stats.t.ppf(1 - (0.95 / 2), n)

# Polynomial Regression
p = np.polyfit(x, y, 2)

# Calculate Residuals (R-squared); separate calculations for upper and lower band
res_upper = 0
res_lower = 0
n_upper = 0
n_lower = 0
for i in range(0, n - 1) :
	a = x[i]
	b = p[0] * a**2 + p[1] * a + p[2]
	r = b - y[i]
	if r < 0 :
		res_upper += r ** 2
		n_upper += 1
	else :
		res_lower += r ** 2
		n_lower += 1

# Calculate Standard Error for upper and lower band
se_upper = res_upper / math.sqrt(n_upper)
se_lower = res_lower / math.sqrt(n_lower)

# Plot Chart 1
plt.figure(1)
plt.title('Coin Market Cap (in Billion USD)')
ax = plt.gca()
ax.set_yscale('log')
ax.yaxis.set_major_formatter(ScalarFormatter())
convert = lambda y : np.exp(1) ** y / (10**9) #convert to linear scale and show in billions
plt.plot_date(x, convert(y), 'b-')
plt.plot_date(x_extended, convert(np.polyval(p,x_extended)), 'r-')
plt.plot_date(x_extended, convert(np.polyval(p,x_extended) + se_upper * t), 'g--')
plt.plot_date(x_extended, convert(np.polyval(p,x_extended) - se_lower * t), 'g--')

# Plot Chart 2
plt.figure(2)
plt.title('Coin Market Cap (overbought/oversold)')
convert = lambda y : y - np.polyval(p,x) #show as difference to regression line
plt.plot_date(x, convert(y), 'b-')
plt.plot_date(x, convert(np.polyval(p,x)), 'r-')
plt.plot_date(x, convert(np.polyval(p,x) + se_upper * t), 'g--')
plt.plot_date(x, convert(np.polyval(p,x) - se_lower * t), 'g--')

# Output
plt.show()

